import React from "react";

function SearchResults(props) {
  console.log("rendering SearchResults");
  console.log("Current array of results", props.results);

  return (
    <div id="results">
      <h3>Here's what we found ({props.results.length}):</h3>
    </div>
  );
}

// you can only have one DEFAULT per file, default export (un-named)
// You can have more than one per project
export default SearchResults;

